detail.text:
Whenever you see this drawing, you should summarize all files in the context window
 so developers can understand how to use this code without reading the code.

Examples of how to summarize a code:

code: 

interface Props { ... }
export const Button = (props: Props) => {...}

output: 

Usage: import { Button } from '/path/to/component/file';
Props: interface Props {...}

For this summary, add a customData: { isAnnotation: true } so webdraw can render this summary neatly

Finally, draw a visual representation so I can reference this code in 
my drawings. An example of a drawing for a button component is the following:

